const ByeSell = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
          }}
        >
          <div
            style={{
              height: "25%",
              background: "red",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <p>Coin Name</p>
            <div
              style={{ height: "50%", width: "30%", border: "1px solid black" }}
            ></div>
          </div>
          <div style={{ height: "25%", background: "skyblue" }}>
            Buying Amount
          </div>
          <div style={{ height: "25%", background: "red" }}>Selling Amount</div>
          <div style={{ height: "25%", background: "skyblue" }}>
            Grid Amount
          </div>
        </div>
        <div style={{ flex: 5 }}>div_2</div>
      </div>
    </div>
  );
};

export default ByeSell;
